  ) AS v(location_id, service_id, phone_id)
),
resolved AS (
  SELECT
    m.resource_table,
    m.resource_id,
    m.field_name,
    m.previous_value,
    m.replacement_value,
    m.created_at AS changed_at,
    m.updated_by,
    l.id AS location_id,
    s.id AS service_id,
    p.id AS phone_id
  FROM metadata m
  LEFT JOIN accessibility_for_disabilities afd
    ON m.resource_table = 'accessibility_for_disabilities'
   AND m.resource_id = afd.id
  LEFT JOIN service_languages sl
    ON m.resource_table = 'service_languages'
   AND m.resource_id = sl.id
  LEFT JOIN holiday_schedules hs
    ON m.resource_table = 'holiday_schedules'
   AND m.resource_id = hs.id
  LEFT JOIN service_areas sa
    ON m.resource_table = 'service_areas'
   AND m.resource_id = sa.id
  LEFT JOIN eligibility e
    ON m.resource_table = 'eligibility'
   AND m.resource_id = e.id
  LEFT JOIN service_taxonomy_specific_attributes stsa
    ON m.resource_table = 'service_taxonomy_specific_attributes'
   AND m.resource_id = stsa.id
  LEFT JOIN required_documents rd
    ON m.resource_table = 'required_documents'
   AND m.resource_id = rd.id
  LEFT JOIN documents_infos di
    ON m.resource_table = 'documents_infos'
   AND m.resource_id = di.id
  LEFT JOIN phones p
    ON m.resource_table = 'phones'
   AND m.resource_id = p.id
  LEFT JOIN event_related_info eri
    ON m.resource_table = 'event_related_info'
   AND m.resource_id = eri.id
  LEFT JOIN services s ON (
       (m.resource_table = 'services' AND m.resource_id = s.id)
    OR sl.service_id   = s.id
    OR hs.service_id   = s.id
    OR sa.service_id   = s.id
    OR e.service_id    = s.id
    OR stsa.service_id = s.id
    OR rd.service_id   = s.id
    OR di.service_id   = s.id
    OR p.service_id    = s.id
    OR eri.service_id  = s.id
  )
  LEFT JOIN service_at_locations sal
    ON sal.service_id = s.id
  LEFT JOIN locations l ON (
       (m.resource_table = 'locations' AND m.resource_id = l.id)
    OR sal.location_id  = l.id
    OR p.location_id    = l.id
    OR eri.location_id  = l.id
    OR afd.location_id  = l.id
  )
  WHERE m.created_at IS NOT NULL
)
,
normalized AS (
  SELECT
    r.*,
    lower(
      regexp_replace(
        regexp_replace(
          trim(coalesce(r.previous_value, '')),
          '^\\s*[?\\-\\*\\u2022]+\\s*',
          '',
          'g'
        ),
        '\\s+',
        ' ',
        'g'
      )
    ) AS prev_norm,
    lower(
      regexp_replace(
        regexp_replace(
          trim(coalesce(r.replacement_value, '')),
          '^\\s*[?\\-\\*\\u2022]+\\s*',
          '',
          'g'
        ),
        '\\s+',
        ' ',
        'g'
      )
    ) AS new_norm
  FROM resolved r
)
,
cleanup_edits AS (
  SELECT
    n.resource_table,
    n.resource_id,
    n.field_name,
    n.previous_value,
    n.replacement_value,
    n.changed_at AS cleanup_at,
    n.updated_by,
    n.location_id,
    n.service_id,
    n.phone_id,
    n.prev_norm
  FROM normalized n
  WHERE n.updated_by = '338c2517-27d5-4d40-ad53-9e6ef71822a6'
    AND n.field_name IN ('description','information','number','extension')
    AND n.resource_table IN ('services','event_related_info','phones')
)
,
cleanup_edits_touched AS (
  SELECT c.*
  FROM cleanup_edits c
  JOIN patched t
    ON t.location_id = c.location_id
   AND coalesce(t.service_id, '00000000-0000-0000-0000-000000000000'::uuid)
       = coalesce(c.service_id, '00000000-0000-0000-0000-000000000000'::uuid)
   AND coalesce(t.phone_id, '00000000-0000-0000-0000-000000000000'::uuid)
       = coalesce(c.phone_id, '00000000-0000-0000-0000-000000000000'::uuid)
)
,
prev_set AS (
  SELECT
    c.resource_table,
    c.resource_id,
    c.field_name,
    c.location_id,
    c.service_id,
    c.phone_id,
    c.cleanup_at,
    max(r.changed_at) AS prev_set_at
  FROM cleanup_edits_touched c
  JOIN normalized r
    ON r.resource_table = c.resource_table
   AND r.resource_id   = c.resource_id
   AND r.field_name    = c.field_name
   AND r.changed_at    < c.cleanup_at
   AND r.new_norm      = c.prev_norm
  GROUP BY
    c.resource_table, c.resource_id, c.field_name,
    c.location_id, c.service_id, c.phone_id, c.cleanup_at
)
,
updates AS (
  SELECT
    resource_table,
    resource_id,
    location_id,
    service_id,
    phone_id,
    prev_set_at AS restore_updated_at
  FROM prev_set
  WHERE prev_set_at IS NOT NULL
)
,
update_services AS (
  UPDATE services s
  SET updated_at = u.restore_updated_at
  FROM updates u
  WHERE u.resource_table = 'services'
    AND u.resource_id = s.id
  RETURNING s.id
),
update_event_info AS (
  UPDATE event_related_info eri
  SET updated_at = u.restore_updated_at
  FROM updates u
  WHERE u.resource_table = 'event_related_info'
    AND u.resource_id = eri.id
  RETURNING eri.id
),
update_phones AS (
  UPDATE phones p
  SET updated_at = u.restore_updated_at
  FROM updates u
  WHERE u.resource_table = 'phones'
    AND u.resource_id = p.id
  RETURNING p.id
)
SELECT
  (SELECT count(*) FROM update_services) AS services_updated,
  (SELECT count(*) FROM update_event_info) AS event_info_updated,
  (SELECT count(*) FROM update_phones) AS phones_updated;
